import React from "react";
import { FiLogOut } from 'react-icons/fi';

class CustomHeader extends React.Component {

  reservationsClick = _ => {
    window.location.replace("/reservations");
  }

  terminsClick = _ => {
    window.location.replace("/");
  }

  historyClick = _ => {
    window.location.replace("/history");
  }

  exitAction = _ => {
    localStorage.removeItem('user');
    window.location.replace("/")
  }

  render() {
    if (this.props.type == 'login') {
      return (
        <div className="auth-header">
          <div className="hospital-logo-name">
            Poliklinika Angel
          </div>
          <div className="hospital-logo-line">
          </div>
        </div>
      );
    } else if (this.props.type == 'doctor') {
      return(
        <div className="client-header">
          <div className="hospital-logo-name">
          Poliklinika Angel
          </div>
          <div className="hospital-logo-line">
          </div>
          <div className="user-name">
            {this.props.name}
            </div>
          <div onClick={this.exitAction} className="logout-button">
            <FiLogOut style={{ color: "white", height: 20, width: 20 }} />
          </div>
        </div>
      );
    }
     else {
      return (
        <div className="client-header">
          <div className="hospital-logo-name">
            Poliklinika Angel
            </div>
          <div className="hospital-logo-line">
          </div>
          <div className="header-item-termins">
            <div onClick={this.terminsClick}>
              Termins
              </div>
          </div>
          <div className="header-item-reservations">
            <div onClick={this.reservationsClick}>
              Reservations
              </div>
          </div>
          <div className="header-item-card">
            <div onClick={this.historyClick}>
              History
                </div>
          </div>
          <div className="user-name">
            {this.props.fullName}
              </div>
          <div onClick={this.exitAction} className="logout-button">
            <FiLogOut style={{ color: "white", height: 20, width: 20 }} />
          </div>
        </div>
      );
    }

  }
}

export { CustomHeader };
